import React from 'react';

class ActionButtons extends React.Component
{
    render() {
        return (
            <div>
                <button type="button" className="btn btn-primary m-3 btn-block" onClick={() => {this.props.callPostAPI()}}>Solve</button>
                <button type="button" className="btn btn-danger m-3 btn-block" onClick={() => {this.props.clearGrid()}}>Clear Grid</button>
                <button type="button" className="btn btn-info m-3 btn-block" onClick={() => {this.props.newRandomGrid()}}>New Random Grid</button>
            </div>
        );
    }
}

export default ActionButtons;
